          <th>Copyright</th>
          <th>Title</th>
          <th>Description</th>
          <th> Action</th>
         
        </tr>
        </thead>
        {booklist.map((c, index) => (
          <tr> 
            <td> {index+1}</td>
          <td>{c.bookname}</td>
          <td>{c.author}</td>
          <td>{c.edition}</td>
          <td>{c.price}</td>
          <td>{c.copyright}</td>
          <td>{c.title}</td>
          <td>{c.desc}</td>
          <td>
          <div className="singlePostEdit">
                <i className="singlePostIcon far fa-edit" onClick={edit}> </i>

